from flask import Flask, jsonify, request, render_template, send_file, make_response
import json
import services.quote
app = Flask(__name__, static_url_path='')

def add_cors_headers(response):
    # response.headers['Content-Type'] = 'application/json'
    response.headers['Access-Control-Allow-Origin'] = '*'
    if request.method == 'OPTIONS':
        response.headers['Access-Control-Allow-Methods'] = 'DELETE,GET,POST,PUT'
        headers = request.headers.get('Access-Control-Request-Headers')
        if headers:
            response.headers['Access-Control-Allow-Headers'] = headers
    return response

app.after_request(add_cors_headers)

@app.route('/', methods=['GET'])
def _get_hardcoded_quote():
    audio_data = b""
    return jsonify(services.quote.get(audio_data))


@app.route('/interpret', methods=['POST'])
def _get_quote():
    audio_data = bytes(request.form.get('audio_data'), 'utf-8')
    return jsonify(services.quote.get(audio_data))


if __name__ == '__main__':
    app.config['JSON_AS_ASCII'] = False
    app.run(host='0.0.0.0', debug=True)